if (typeof window !== "undefined") {
install();
}

// if you don't use next.js, this should work

install();


function App() {
  // const [currentContext, setCurrentContext] = useState("");
  let currentContext = "";

  axios.get('http://localhost:8080/api/v1/kubernetes/currentContext')
  .then(response => {
    currentContext = response.data;
      setDisplay(true)
    }).catch(error =>{
    console.log(error)
  })

  return (
    <div className="App">
      <header className="App-header">
        {currentContext}
      </header>
    </div>
  );
}

export default App;
